class Addres {  late String latitude;  late String longitude;  late String home;  late String kvNumber;  late  String float;  late  String floorCode;  late  String fromGeocoding;  Addres({    required this.latitude,    required    this.longitude,    required   this.home,    required    this.kvNumber,    required   this.float,    required   this.fromGeocoding,    required      this.floorCode,});  Addres.fromJson(dynamic json) {    latitude = json['latitude'];    longitude = json['longitude'];    home = json['home'];    kvNumber = json['kvNumber'];    float = json['float'];    fromGeocoding = json['fromGeocoding'];    floorCode = json['floorCode'];  }  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['latitude'] = latitude;    map['longitude'] = longitude;    map['home'] = home;    map['kvNumber'] = kvNumber;    map['fromGeocoding'] = fromGeocoding;    map['float'] = float;    map['floorCode'] = floorCode;    return map;  }}